(3, '2020-08-22 03:54:10', '2020-08-23 10:02:11', 'approved', '<p>1) Получить ЭЦП можно&nbsp; онлайн ( через сайт e-imzo.uz)&nbsp; и обычным путем через единое окно // скрины приложены во вложении<br><br>2) Открыть фирму можно также <b><span style=\\\"background-color: rgb(255, 255, 0);\\\">онлайн</span></b> :<br>-<span class=\\\"text-center\\\">Получить ЭЦП ключ в любой Государственной налоговой инспекции района или города. <a href=\\\"https://my.soliq.uz/main/howtoget-eds\\\">my.soliq.uz</a><br>-</span><span class=\\\"text-center\\\">Затем пройти регистрацию на сайте <a href=\\\"https://id.gov.uz/oid/cmn/regUser/register.do\\\">id.gov.uz</a> для получения Логина и Пароля<br>-</span><span class=\\\"text-center\\\">Зайти на сайт <a href=\\\"https://fo.birdarcha.uz\\\">fo.birdarcha.uz</a> вести Логин и Пароль полученный во время регистрации на Id.gov.uz<br>-</span><span class=\\\"text-center\\\">После входа в систему зайти в раздел \\\"Регистрация Бизнеса\\\" и пройти поэтапно все шаги<br><u><br>Второй вариант </u>в явочном порядке :<br>-</span><span class=\\\"text-center\\\">Обратится в Центр государственных услуг вашего района или города для заполнения необходимых данных<br>-</span><span class=\\\"text-center\\\">После заполнения необходимых данных&nbsp; будет выдан номер Инвойса на который производиться оплата<br>-</span><span class=\\\"text-center\\\">После удачной оплаты  автоматически сформируется&nbsp; \\\"Свидетельство\\\" которое вы получите от сотрудника ЦГУ<br><br><br><br>3) Зарегистрировать фирму на&nbsp; площадке DXARID можно на сайте </span><a href=\\\"https://dxarid.uzex.uz/auth/register\\\">https://dxarid.uzex.uz/auth/register</a><a href=\\\"https://dxarid.uzex.uz/auth/register\\\"> // <br></a><span class=\\\"text-center\\\"></span>на площадке EXARID можно на сайте exarid.uzex.uz<br><span class=\\\"text-center\\\"></span></p>', '', 88, 24, 0),
