(1, 1, '2020-04-30 13:22:14', '2020-04-30 10:22:14', '<!-- wp:paragraph -->\r\n<p>&nbsp;</p>\r\n<!-- /wp:paragraph -->\r\n\r\n<!-- wp:paragraph -->\r\n<p>\"АССОЦИАЦИЯ БРОКЕРОВ» некоммерческая организация целью которой является развитие института государственных и корпоративных закупок, и активное участие при разработке новых решений для биржевой деятельности.</p>\r\n<!-- /wp:paragraph -->\r\n\r\n<!-- wp:spacer {\"height\":47} -->\r\n<div class=\"wp-block-spacer\" style=\"height: 47px;\" aria-hidden=\"true\"> </div>\r\n<!-- /wp:spacer -->\r\n\r\n<!-- wp:paragraph -->\r\n<p>В задачи Ассоциации входит создание общественного контроля закупочных процедур в целях развития и содействия государственным контрольным органам в совершенствовании процедур государственных и корпоративных закупок, выявления и предупреждения нарушений, контроль за исполнением требований законодательства о государственных закупках. </p>\r\n<!-- /wp:paragraph -->\r\n\r\n<!-- wp:spacer {\"height\":47} -->\r\n<div class=\"wp-block-spacer\" style=\"height: 47px;\" aria-hidden=\"true\"> </div>\r\n<!-- /wp:spacer -->\r\n\r\n<!-- wp:paragraph -->\r\n<p>Деятельность организации направлена на создание здоровой конкуренции, открытости и прозрачности в государственных и корпоративных закупках, а также внедрение современных инструментов для эффективного и рационального использования финансовых средств. </p>\r\n<!-- /wp:paragraph -->\r\n\r\n<!-- wp:spacer {\"height\":47} -->\r\n<div class=\"wp-block-spacer\" style=\"height: 47px;\" aria-hidden=\"true\"> </div>\r\n<!-- /wp:spacer -->\r\n\r\n<!-- wp:paragraph -->\r\n<p>В частности Ассоциация Брокеров активно участвует в разработке современных решений и правил торговли, в том числе в IT проектах, способствующих выходу биржи на мировой уровень.</p>\r\n<!-- /wp:paragraph -->\r\n\r\n<!-- wp:paragraph -->\r\n<p>В условиях создания государством благоприятного инвестиционного климата и деловой среды, Ассоциация успешно привлекает иностранные инвестиции в важные строительные и социальные проекты расширяющие возможности развития экономики страны, и повышающие качество экономического и социального развития.</p>\r\n<!-- /wp:paragraph -->\r\n\r\n<!-- wp:spacer {\"height\":47} -->\r\n<div class=\"wp-block-spacer\" style=\"height: 47px;\" aria-hidden=\"true\"> </div>\r\n<!-- /wp:spacer -->\r\n\r\n<!-- wp:paragraph -->\r\n<p>Ассоциация уделяет огромное внимание обучению и развитию практических навыков работы на товарной бирже, а также программе повышения профессиональной квалификации брокеров товарно-сырьевой биржи Узбекистана.  Группой компаний создан центр обучения специалистов в области тендеров (государственных и корпоративных закупок, закупочных конкурсов, аукционов) и брокерской деятельности (биржевых трейдеров и регистраторов). В перечень услуг центра входит подготовка к тестам на УзРТСБ.</p>\r\n<!-- /wp:paragraph -->', 'Об Ассоциации', '\"АССОЦИАЦИЯ БРОКЕРОВ» некоммерческая организация целью которой является развитие института государственных и корпоративных закупок, и активное участие при разработке новых решений для биржевой деятельности.', 'publish', 'open', 'open', '', '%d1%81%d1%82%d0%b0%d1%82%d1%8c%d1%8f-%d0%be%d0%b1-%d0%b0%d1%81%d1%81%d0%be%d1%86%d0%b8%d0%b0%d1%86%d0%b8%d0%b8', '', '', '2020-07-21 03:00:48', '2020-07-21 00:00:48', '', 0, 'http://abrok.uz/?p=1', 0, 'post', '', 1),
(2, 1, '2020-04-30 13:22:14', '2020-04-30 10:22:14', '<!-- wp:paragraph -->\n<p>Это пример страницы. От записей в блоге она отличается тем, что остаётся на одном месте и отображается в меню сайта (в большинстве тем). На странице &laquo;Детали&raquo; владельцы сайтов обычно рассказывают о себе потенциальным посетителям. Например, так:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Привет! Днём я курьер, а вечером &#8212; подающий надежды актёр. Это мой блог. Я живу в Ростове-на-Дону, люблю своего пса Джека и пинаколаду. (И ещё попадать под дождь.)</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>...или так:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Компания &laquo;Штучки XYZ&raquo; была основана в 1971 году и с тех пор производит качественные штучки. Компания находится в Готэм-сити, имеет штат из более чем 2000 сотрудников и приносит много пользы жителям Готэма.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>Перейдите <a href=\"http://abrok.uz/wp-admin/\">в консоль</a>, чтобы удалить эту страницу и создать новые. Успехов!</p>\n<!-- /wp:paragraph -->', 'Пример страницы', '', 'publish', 'closed', 'closed', '', 'sample-page', '', '', '2020-07-06 19:14:37', '2020-07-06 16:14:37', '', 0, 'http://abrok.uz/?page_id=2', 0, 'page', '', 0),
(3, 1, '2020-04-30 13:22:14', '2020-04-30 10:22:14', '<!-- wp:heading --><h2>Кто мы</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Наш адрес сайта: http://abrok.uz.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Какие персональные данные мы собираем и с какой целью</h2><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Комментарии</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Если посетитель оставляет комментарий на сайте, мы собираем данные указанные в форме комментария, а также IP адрес посетителя и данные user-agent браузера с целью определения спама.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Анонимизированная строка создаваемая из вашего адреса email (\"хеш\") может предоставляться сервису Gravatar, чтобы определить используете ли вы его. Политика конфиденциальности Gravatar доступна здесь: https://automattic.com/privacy/ . После одобрения комментария ваше изображение профиля будет видимым публично в контексте вашего комментария.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Медиафайлы</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Если вы зарегистрированный пользователь и загружаете фотографии на сайт, вам возможно следует избегать загрузки изображений с метаданными EXIF, так как они могут содержать данные вашего месторасположения по GPS. Посетители могут извлечь эту информацию скачав изображения с сайта.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Формы контактов</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Куки</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Если вы оставляете комментарий на нашем сайте, вы можете включить сохранение вашего имени, адреса email и вебсайта в куки. Это делается для вашего удобства, чтобы не заполнять данные снова при повторном комментировании. Эти куки хранятся в течение одного года.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Если у вас есть учетная запись на сайте и вы войдете в неё, мы установим временный куки для определения поддержки куки вашим браузером, куки не содержит никакой личной информации и удаляется при закрытии вашего браузера.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>При входе в учетную запись мы также устанавливаем несколько куки с данными входа и настройками экрана. Куки входа хранятся в течение двух дней, куки с настройками экрана - год. Если вы выберете возможность \"Запомнить меня\", данные о входе будут сохраняться в течение двух недель. При выходе из учетной записи куки входа будут удалены.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>При редактировании или публикации статьи в браузере будет сохранен дополнительный куки, он не содержит персональных данных и содержит только ID записи отредактированной вами, истекает через 1 день.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Встраиваемое содержимое других вебсайтов</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Статьи на этом сайте могут включать встраиваемое содержимое (например видео, изображения, статьи и др.), подобное содержимое ведет себя так же, как если бы посетитель зашел на другой сайт.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Эти сайты могут собирать данные о вас, использовать куки, внедрять дополнительное отслеживание третьей стороной и следить за вашим взаимодействием с внедренным содержимым, включая отслеживание взаимодействия, если у вас есть учетная запись и вы авторизовались на том сайте.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Веб-аналитика</h3><!-- /wp:heading --><!-- wp:heading --><h2>С кем мы делимся вашими данными</h2><!-- /wp:heading --><!-- wp:heading --><h2>Как долго мы храним ваши данные</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Если вы оставляете комментарий, то сам комментарий и его метаданные сохраняются неопределенно долго. Это делается для того, чтобы определять и одобрять последующие комментарии автоматически, вместо помещения их в очередь на одобрение.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Для пользователей с регистрацией на нашем сайте мы храним ту личную информацию, которую они указывают в своем профиле. Все пользователи могут видеть, редактировать или удалить свою информацию из профиля в любое время (кроме имени пользователя). Администрация вебсайта также может видеть и изменять эту информацию.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Какие у вас права на ваши данные</h2><!-- /wp:heading --><!-- wp:paragraph --><p>При наличии учетной записи на сайте или если вы оставляли комментарии, то вы можете запросить файл экспорта персональных данных, которые мы сохранили о вас, включая предоставленные вами данные. Вы также можете запросить удаление этих данных, это не включает данные, которые мы обязаны хранить в административных целях, по закону или целях безопасности.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Куда мы отправляем ваши данные</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Комментарии пользователей могут проверяться автоматическим сервисом определения спама.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Ваша контактная информация</h2><!-- /wp:heading --><!-- wp:heading --><h2>Дополнительная информация</h2><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Как мы защищаем ваши данные</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Какие принимаются процедуры против взлома данных</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>От каких третьих сторон мы получаем данные</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Какие автоматические решения принимаются на основе данных пользователей</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Требования к раскрытию отраслевых нормативных требований</h3><!-- /wp:heading -->', 'Политика конфиденциальности', '', 'draft', 'closed', 'open', '', 'privacy-policy', '', '', '2020-04-30 13:22:14', '2020-04-30 10:22:14', '', 0, 'http://abrok.uz/?page_id=3', 0, 'page', '', 0),
