(543, 8, '2020-10-18 17:16:28', '2020-10-18 14:16:28', '10 октября текущего года, на логистическом портале <strong><a href=\"http://transport.uzex.uz/\">transport.uzex.uz</a></strong>, оператором которого является Узбекская республиканская товарно-сырьевая биржа, успешно состоялись 2 сделки по доставке клиентам товаров.\r\n<div class=\"changeCon\">\r\n<div></div>\r\n<div>Первые сделки по логистике заключены по доставке покупателю 150 тонн различных марок цемента, приобретенных через биржевые торги в Джизакской области на общую сумму 5,3 млн. сумов.</div>\r\n<div></div>\r\n<div>Новая электронная торговая платформа биржи предназначена для оказания логистических услуг по доставке клиентам товаров, в том числе реализованной через биржу высоколиквидной продукции.</div>\r\n<div></div>\r\n<div>Для пользования услугой грузоперевозчиков заказчики могут дать объявления на портале о перевозке товаров, указав всю информацию о грузе и месте доставки.</div>\r\n<div></div>\r\n<div>В свою очередь, грузоперевозчики через персональный кабинет дают свои предложения на заявку, после чего заказчик выбирает подходящие предложения грузоперевозчиков и система в автоматическом режиме отбирает наименьшую цену из выбранных предложений.</div>\r\n<div></div>\r\n<div>Также, участники могут воспользоваться механизмом гарантии исполнения сделок путем осуществления оплаты за перевозку товара через расчетно-клиринговую палату биржи.</div>\r\n</div>\r\n<p class=\"r\"><strong>Источник </strong>: <a href=\"https://uzex.uz/ru/news/2020/10/12/the-first-transactions-concluded-on-the-logistics-portal-uzex/the-first-transactions-concluded-on-the-logistics-portal-uzex\" target=\"_blank\" rel=\"noopener noreferrer\">\"ЎзРТХБ\" АЖ PR бўлими</a></p>', 'НА ЛОГИСТИЧЕСКОМ ПОРТАЛЕ БИРЖИ ЗАКЛЮЧЕНЫ ПЕРВЫЕ СДЕЛКИ', '', 'inherit', 'closed', 'closed', '', '541-revision-v1', '', '', '2020-10-18 17:16:28', '2020-10-18 14:16:28', '', 541, 'https://abrok.uz/2020/10/18/541-revision-v1/', 0, 'revision', '', 0),
(454, 8, '2020-09-03 14:59:33', '2020-09-03 11:59:33', '<p class=\"aligncenter\">[wpm_video video=https://youtu.be/elu4Ew30600 ratio=16by9 autoplay=off]</p>', 'Урок 2.1. Выставочно-ярмарочные торги', '', 'publish', 'open', 'closed', '', '%d1%83%d1%80%d0%be%d0%ba-2-1-%d0%b2%d1%8b%d1%81%d1%82%d0%b0%d0%b2%d0%be%d1%87%d0%bd%d0%be-%d1%8f%d1%80%d0%bc%d0%b0%d1%80%d0%be%d1%87%d0%bd%d1%8b%d0%b5-%d1%82%d0%be%d1%80%d0%b3%d0%b8', '', '', '2020-11-11 15:18:34', '2020-11-11 12:18:34', '', 0, 'https://abrok.uz/?post_type=wpm-page&#038;p=454', 19, 'wpm-page', '', 0),
(62, 8, '2020-06-07 22:57:06', '2020-06-07 19:57:06', '<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>\"АССОЦИАЦИЯ БРОКЕРОВ» некоммерческая организация целью которой является развитие института государственных и корпоративных закупок, и активное участие при разработке новых решений для биржевой деятельности.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>В задачи Ассоциации входит создание общественного контроля закупочных процедур в целях развития и содействия государственным контрольным органам в совершенствовании процедур государственных и корпоративных закупок, выявления и предупреждения нарушений, контроль за исполнением требований законодательства о государственных закупках.&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Деятельность организации направлена на создание здоровой конкуренции, открытости и прозрачности в государственных и корпоративных закупках, а также внедрение современных инструментов для эффективного и рационального использования финансовых средств.&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>В частности Ассоциация Брокеров активно участвует в разработке современных решений и правил торговли, в том числе в IT проектах, способствующих выходу биржи на мировой уровень.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>В условиях создания государством благоприятного инвестиционного климата и деловой среды, Ассоциация успешно привлекает иностранные инвестиции в важные строительные и социальные проекты расширяющие возможности развития экономики страны, и повышающие качество экономического и социального развития.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Ассоциация уделяет огромное внимание обучению и развитию практических навыков работы на товарной бирже, а также программе повышения профессиональной квалификации брокеров товарно-сырьевой биржи Узбекистана. &nbsp;Группой компаний создан центр обучения специалистов в области тендеров (государственных и корпоративных закупок, закупочных конкурсов, аукционов) и брокерской деятельности (биржевых трейдеров и регистраторов). В перечень услуг центра входит подготовка к тестам на УзРТСБ.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'Об Ассоциации', '', 'publish', 'closed', 'closed', '', '%d0%be-%d0%ba%d0%be%d0%bc%d0%bf%d0%b0%d0%bd%d0%b8%d0%b8', '', '', '2020-07-06 19:05:24', '2020-07-06 16:05:24', '', 0, 'https://abrok.uz/?page_id=62', 0, 'page', '', 0),
