(549, 8, '2020-10-27 21:38:04', '2020-10-27 18:38:04', 'В целях обеспечения и сохранения за счёт импорта стабилизации внутренних цен на продовольственную продукцию и другие товарные ресурсы АО «Узбекская республиканская товарно-сырьевая биржа» продолжает расширять свою сеть зарубежных торговых площадок.\r\n<div class=\"changeCon\">\r\n\r\nТак, в результате проведения переговоров с деловыми партнерами, новые торговые площадки биржи открылись в Российской Федерации и Республике Таджикистан.\r\n\r\nВ частности, зарубежные торговые площадки начали функционировать в российском городе Пермь при содействии Российского Фонда содействия экспортно-импортной деятельности, а также в столице Республики Таджикистан – Душанбе при сотрудничестве с Центрально-Азиатской Фондовой биржей.\r\n\r\nС запуском новых торговых площадок появляется возможность свободно импортировать зерно, сахар, растительные масла и другую продукцию через электронные торговые системы биржи. При этом, иностранные компании смогут напрямую выйти на товарные рынки Узбекистана используя возможности рыночного механизма биржевой торговли и электронной коммерции.\r\n\r\nДанная электронная торговая система обладает такими преимуществами как единый механизм обслуживания клиентов, прозрачность осуществления торговли и взаиморасчётов, прямой доступ к надёжным товаропроизводителям, экономия времени и средств, а также гарантия оплаты и доставки товаров.\r\n\r\nВ свою очередь, местные товаропроизводители и предприниматели также смогут воспользоваться биржевыми и маркетинговыми услугами зарубежных торговых площадок биржи для эффективного продвижения своих товаров на внешние рынки.\r\n\r\nНапомним, что международная торговая сеть Узбекской республиканской товарно-сырьевой биржи охватывает торговые офисы биржи, расположенные в Республике Беларусь, Республике Казахстан, Республике Кыргызстан, Российской Федерации и Китайской Народной Республики.\r\n\r\n</div>\r\n<p class=\"r\"><strong>Источник </strong>: <a href=\"https://uzex.uz/ru/news/2020/10/27/new-foreign-trading-platforms-of-the-exchange-were-opened/new-foreign-trading-platforms-of-the-exchange-were-opened\" target=\"_blank\" rel=\"noopener noreferrer\">\"ЎзРТХБ\" АЖ PR бўлими</a></p>', 'ОТКРЫЛИСЬ НОВЫЕ ЗАРУБЕЖНЫЕ ТОРГОВЫЕ ПЛОЩАДКИ БИРЖИ', '', 'inherit', 'closed', 'closed', '', '547-revision-v1', '', '', '2020-10-27 21:38:04', '2020-10-27 18:38:04', '', 547, 'https://abrok.uz/2020/10/27/547-revision-v1/', 0, 'revision', '', 0),
