(141, 8, '2020-07-06 19:04:24', '2020-07-06 16:04:24', '<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>\"АССОЦИАЦИЯ БРОКЕРОВ» некоммерческая организация целью которой является развитие института государственных и корпоративных закупок, и активное участие при разработке новых решений для биржевой деятельности.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>В задачи Ассоциации входит создание общественного контроля закупочных процедур в целях развития и содействия государственным контрольным органам в совершенствовании процедур государственных и корпоративных закупок, выявления и предупреждения нарушений, контроль за исполнением требований законодательства о государственных закупках.&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Деятельность организации направлена на создание здоровой конкуренции, открытости и прозрачности в государственных и корпоративных закупках, а также внедрение современных инструментов для эффективного и рационального использования финансовых средств.&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>В частности Ассоциация Брокеров активно участвует в разработке современных решений и правил торговли, в том числе в IT проектах, способствующих выходу биржи на мировой уровень.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>В условиях создания государством благоприятного инвестиционного климата и деловой среды, Ассоциация успешно привлекает иностранные инвестиции в важные строительные и социальные проекты расширяющие возможности развития экономики страны, и повышающие качество экономического и социального развития.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Ассоциация уделяет огромное внимание обучению и развитию практических навыков работы на товарной бирже, а также программе повышения профессиональной квалификации брокеров товарно-сырьевой биржи Узбекистана. &nbsp;Группой компаний создан центр обучения специалистов в области тендеров (государственных и корпоративных закупок, закупочных конкурсов, аукционов) и брокерской деятельности (биржевых трейдеров и регистраторов). В перечень услуг центра входит подготовка к тестам на УзРТСБ.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'Об Ассоциации', '', 'inherit', 'closed', 'closed', '', '62-revision-v1', '', '', '2020-07-06 19:04:24', '2020-07-06 16:04:24', '', 62, 'https://abrok.uz/2020/07/06/62-revision-v1/', 0, 'revision', '', 0),
(140, 8, '2020-07-06 19:02:46', '2020-07-06 16:02:46', '<!-- wp:paragraph -->\n<p>\"АССОЦИАЦИЯ БРОКЕРОВ» некоммерческая организация целью которой является развитие института государственных и корпоративных закупок, и активное участие при разработке новых решений для биржевой деятельности.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>В задачи Ассоциации входит создание общественного контроля закупочных процедур в целях развития и содействия государственным контрольным органам в совершенствовании процедур государственных и корпоративных закупок, выявления и предупреждения нарушений, контроль за исполнением требований законодательства о государственных закупках.&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Деятельность организации направлена на создание здоровой конкуренции, открытости и прозрачности в государственных и корпоративных закупках, а также внедрение современных инструментов для эффективного и рационального использования финансовых средств.&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>В частности Ассоциация Брокеров активно участвует в разработке современных решений и правил торговли, в том числе в IT проектах, способствующих выходу биржи на мировой уровень.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>В условиях создания государством благоприятного инвестиционного климата и деловой среды, Ассоциация успешно привлекает иностранные инвестиции в важные строительные и социальные проекты расширяющие возможности развития экономики страны, и повышающие качество экономического и социального развития.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Ассоциация уделяет огромное внимание обучению и развитию практических навыков работы на товарной бирже, а также программе повышения профессиональной квалификации брокеров товарно-сырьевой биржи Узбекистана. &nbsp;Группой компаний создан центр обучения специалистов в области тендеров (государственных и корпоративных закупок, закупочных конкурсов, аукционов) и брокерской деятельности (биржевых трейдеров и регистраторов). В перечень услуг центра входит подготовка к тестам на УзРТСБ.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'Об Ассоциации', '', 'inherit', 'closed', 'closed', '', '62-revision-v1', '', '', '2020-07-06 19:02:46', '2020-07-06 16:02:46', '', 62, 'https://abrok.uz/2020/07/06/62-revision-v1/', 0, 'revision', '', 0),
(404, 8, '2020-08-15 16:10:47', '2020-08-15 13:10:47', '<div class=\"changeCon\">\r\n<div>На веб-сайте Узбекской республиканской товарно-сырьевой биржи по электронному конкурсу и тендеру <a href=\"http://etender.uzex.uz/home\"><strong>etender.uzex.uz</strong></a>, с момента запуска данной торговой системы заключено 38 сделок на сумму 6,6 млрд сумов. В электронных конкурсах и тендерах приняли участие 58 государственных заказчиков и 85 участников, то есть поставщиков товаров.</div>\r\n<div></div>\r\n<div>В результате проведения конкурсов и тендеров по государственным закупкам в электронной форме заказчики сэкономили 488,1 млн сумов.</div>\r\n<div></div>\r\n<div>Наиболее крупные сделки по электронным конкурсам и тендерам заключены в Наманганской области (37%) и в городе Ташкенте (30%). На следующих местах расположились Бухарская и Сырдарьинская области доля которых составила 19% и 8% соответственно.</div>\r\n<div></div>\r\n<div>Напомним, что торговая система по электронным конкурсам и тендерам <a href=\"http://etender.uzex.uz/home\"><strong>etender.uzex.uz</strong></a> запущена в мае текущего года оператором специального информационного портала по государственным закупкам – Узбекской республиканской товарно-сырьевой биржей в целях повышения прозрачности и эффективности конкурсов и тендеров.</div>\r\n<div></div>\r\n<div>Для участия в электронных конкурсах и тендерах поставщикам необходимо пройти онлайн-регистрацию на сайте <a href=\"http://etender.uzex.uz/home\"><strong>etender.uzex.uz</strong></a> и внести залоговые средства.</div>\r\n<div></div>\r\n<div></div>\r\n</div>\r\n<p class=\"r\"><strong>Источник </strong>: <a href=\"http://uzex.uz/ru/news/2020/8/14/transactions-in-the-amount-of-6-6-billion-soums-were-concluded-on-e-tenders/transactions-in-the-amount-of-6-6-billion-soums-were-concluded-on-e-tenders\" target=\"_blank\" rel=\"noopener noreferrer\">\"ЎзРТХБ\" АЖ PR бўлими</a></p>', 'На etender.uzex.uz заключено сделок на сумму 6,6 млрд сум', '', 'publish', 'open', 'open', '', '%d0%bd%d0%b0-etender-uzex-uz-%d0%b7%d0%b0%d0%ba%d0%bb%d1%8e%d1%87%d0%b5%d0%bd%d0%be-%d1%81%d0%b4%d0%b5%d0%bb%d0%be%d0%ba-%d0%bd%d0%b0-%d1%81%d1%83%d0%bc%d0%bc%d1%83-66-%d0%bc%d0%bb%d1%80%d0%b4-%d1%81', '', '', '2020-08-15 16:16:47', '2020-08-15 13:16:47', '', 0, 'https://abrok.uz/?p=404', 0, 'post', '', 0),
(143, 1, '2020-07-06 19:08:58', '2020-07-06 16:08:58', '<!-- wp:paragraph -->\n<p>Миссия Ассоциации заключается в совершенствовании форм и методов государственных и корпоративных закупок ведущей к созданию независимой и эффективной системы процедур.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Для вступления в члены Ассоциации кандидат (физическое или юридическое лицо) должен подать в адрес Ассоциации письменное мотивированное заявление, анкету по форме, установленной организацией и следующие документы:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Физические лица:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>— копию документа, удостоверяющего личность претендента;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>— копию свидетельства о постановке заявителя на учет в налоговом органе с указанием идентификационного номера налогоплательщика (ИНН)</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Юридические лица:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>— копию устава организации;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>— копию документа, подтверждающего факт внесения записи в Государственный реестр (в т.ч. для индивидуальных предпринимателей);</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>— копию свидетельства о постановке претендента на учет в налоговом органе;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>— протокол собрания (заседания) высшего органа управления юридического лица с решением о вступлении в члены Ассоциации;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>— изображение логотипа организации в электронном виде;</p>\n<!-- /wp:paragraph -->', 'Стать участником', '', 'publish', 'closed', 'closed', '', '%d1%81%d1%82%d0%b0%d1%82%d1%8c-%d1%83%d1%87%d0%b0%d1%81%d1%82%d0%bd%d0%b8%d0%ba%d0%be%d0%bc', '', '', '2020-07-06 19:15:51', '2020-07-06 16:15:51', '', 0, 'https://abrok.uz/?page_id=143', 0, 'page', '', 0),
