(146, 8, '2020-07-06 19:14:37', '2020-07-06 16:14:37', '<!-- wp:paragraph -->\n<p>Это пример страницы. От записей в блоге она отличается тем, что остаётся на одном месте и отображается в меню сайта (в большинстве тем). На странице &laquo;Детали&raquo; владельцы сайтов обычно рассказывают о себе потенциальным посетителям. Например, так:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Привет! Днём я курьер, а вечером &#8212; подающий надежды актёр. Это мой блог. Я живу в Ростове-на-Дону, люблю своего пса Джека и пинаколаду. (И ещё попадать под дождь.)</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>...или так:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Компания &laquo;Штучки XYZ&raquo; была основана в 1971 году и с тех пор производит качественные штучки. Компания находится в Готэм-сити, имеет штат из более чем 2000 сотрудников и приносит много пользы жителям Готэма.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>Перейдите <a href=\"http://abrok.uz/wp-admin/\">в консоль</a>, чтобы удалить эту страницу и создать новые. Успехов!</p>\n<!-- /wp:paragraph -->', 'Пример страницы', '', 'inherit', 'closed', 'closed', '', '2-revision-v1', '', '', '2020-07-06 19:14:37', '2020-07-06 16:14:37', '', 2, 'https://abrok.uz/2020/07/06/2-revision-v1/', 0, 'revision', '', 0),
(149, 8, '2020-07-06 19:21:47', '2020-07-06 16:21:47', '<!-- wp:paragraph -->\n<p>Развитие Ассоциации Брокеров в Узбекистане напрямую зависит от построения партнерских отношений с организациями различных направлений.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Партнером Ассоциации Брокеров может выступить любое физическое или юридическое лицо, имеющее интерес к биржевой деятельности желающее оказать ему поддержку различного рода. Для заключения партнерских отношений с Ассоциацией Брокеров вы можете отправить запрос и мы заключим с вами индивидуальный договор на взаимовыгодных условиях.</p>\n<!-- /wp:paragraph -->', 'Стать партнером', '', 'publish', 'closed', 'closed', '', '%d1%81%d1%82%d0%b0%d1%82%d1%8c-%d0%bf%d0%b0%d1%80%d1%82%d0%bd%d0%b5%d1%80%d0%be%d0%bc', '', '', '2020-07-06 19:21:48', '2020-07-06 16:21:48', '', 0, 'https://abrok.uz/?page_id=149', 0, 'page', '', 0),
