(153, 8, '2020-07-06 19:26:44', '2020-07-06 16:26:44', '<!-- wp:spacer {\"height\":57} -->\r\n<div class=\"wp-block-spacer\" style=\"height: 57px;\" aria-hidden=\"true\"> </div>\r\n<!-- /wp:spacer -->\r\n\r\n<!-- wp:heading {\"level\":3} -->\r\n<h3><strong>Консалтинг</strong></h3>\r\n<!-- /wp:heading -->\r\n\r\n<!-- wp:list {\"ordered\":true} -->\r\n<ol>\r\n<li>Консультация по вопросам государственных закупок и биржевых торгов  в Узбекистане;</li>\r\n<li>Консультация по вопросам ведения деятельности корпоративных закупок;</li>\r\n<li>Консультация по вопросам участия в конкурсах и тендерах;</li>\r\n<li>Предоставление информации (описание и цены) о технологиях, оборудовании и сырье в зарубежных странах;</li>\r\n<li>Содействие от Ассоциации в поиске лотов;</li>\r\n<li>Содействие в поиске трейдеров ;</li>\r\n<li>Поддержка в налаживании деловых контактов с зарубежными партнерами Ассоциации; Предоставление базы данных по сфере и стране (список проверенных поставщиков, производителей и закупщиков) зарубежных стран;</li>\r\n</ol>\r\n<!-- /wp:list -->\r\n\r\n<!-- wp:separator --><hr class=\"wp-block-separator\" /><!-- /wp:separator -->\r\n\r\n<!-- wp:group -->\r\n<div class=\"wp-block-group\">\r\n<div class=\"wp-block-group__inner-container\"><!-- wp:heading {\"level\":3} -->\r\n<h3> </h3>\r\n<h3><strong>Юридическое сопровождение</strong></h3>\r\n<!-- /wp:heading --></div>\r\n</div>\r\n<!-- /wp:group -->\r\n\r\n<!-- wp:group -->\r\n<div class=\"wp-block-group\">\r\n<div class=\"wp-block-group__inner-container\"><!-- wp:list {\"ordered\":true} -->\r\n<ol>\r\n<li>Содействие в экспортных вопросах;</li>\r\n<li>Содействие в регистрации на ЭТП;</li>\r\n<li>Юридические консультации по вопросам участия в тендере и подписания контрактов</li>\r\n<li>Подготовка пакета документов и подача заявки на участие</li>\r\n<li>Заключение контракта с заказчиком</li>\r\n<li>Сопровождение торгов от имени заказчика</li>\r\n<li>Контроль выплаты денежных средств заказчиком</li>\r\n<li>Обжалование резу