(159, 8, '2020-07-06 19:43:19', '2020-07-06 16:43:19', '<!-- wp:heading -->\n<h2><strong>Госзакупки и Тендеры</strong></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Онлайн курс обучения &nbsp;в области тендеров (государственных и корпоративных закупок, закупочных конкурсов, аукционов).</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul><li>В курс программы входит 16 онлайн уроков, включающие реальный опыт и необходимые знания, для достижения главной цели обучения – выигрыша реального тендера.</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:list -->\n<ul><li>Длительность процесса обучения 30 дней.</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:list -->\n<ul><li>В рамках курса обучения начинающие предприниматели узнают и поймут, как работает биржа, научатся выигрывать тендеры,  а те кто уже имеет опыт работы на бирже получат доступ к секретным инструментам и знаниям для результативной работы на торговых площадках.</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:heading -->\n<h2><strong>Успешный брокер</strong></h2>\n<!-- /wp:heading -->\n\n<!-- wp:list -->\n<ul><li>Отличное решение для брокерских компаний, желающих расширить штат трейдеров в торговом зале.</li><li>Инновационная программа подготовки специалистов биржевого, товарного рынка Узбекистана.</li><li>Данный курс рекомендуется тем, кто хочет обучиться профессии брокера, а также для бизнесменов, которые устали выплачивать постоянный % брокерам и решили обучится сами или обучить сотрудника.</li><li>Эффективный курс подготовки трейдеров к тестам на бирже УзРТСБ. Мы помогаем пройти аттестацию на UZEX.</li></ul>\n<!-- /wp:list -->', 'Обучение', '', 'inherit', 'closed', 'closed', '', '158-revision-v1', '', '', '2020-07-06 19:43:19', '2020-07-06 16:43:19', '', 158, 'https://abrok.uz/2020/07/06/158-revision-v1/', 0, 'revision', '', 0),
