(165, 8, '2020-07-06 19:51:04', '2020-07-06 16:51:04', '<!-- wp:spacer {\"height\":57} -->\n<div style=\"height:57px\" aria-hidden=\"true\" class=\"wp-block-spacer\"></div>\n<!-- /wp:spacer -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3><strong>Консалтинг</strong></h3>\n<!-- /wp:heading -->\n\n<!-- wp:list {\"ordered\":true} -->\n<ol><li>Консультация по вопросам государственных закупок и биржевых торгов  в Узбекистане;</li><li>Консультация по вопросам ведения деятельности корпоративных закупок;</li><li>Консультация по вопросам участия в конкурсах и тендерах;</li><li>Предоставление информации (описание и цены) о технологиях, оборудовании и сырье в зарубежных странах;</li><li>Содействие от Ассоциации в поиске лотов;</li><li>Содействие в поиске трейдеров ;</li><li>Поддержка в налаживании деловых контактов с зарубежными партнерами Ассоциации; Предоставление базы данных по сфере и стране (список проверенных поставщиков, производителей и закупщиков) зарубежных стран;</li></ol>\n<!-- /wp:list -->\n\n<!-- wp:separator -->\n<hr class=\"wp-block-separator\"/>\n<!-- /wp:separator -->\n\n<!-- wp:group -->\n<div class=\"wp-block-group\"><div class=\"wp-block-group__inner-container\"><!-- wp:heading {\"level\":3} -->\n<h3><strong>Юридическое сопровождение</strong></h3>\n<!-- /wp:heading --></div></div>\n<!-- /wp:group -->\n\n<!-- wp:group -->\n<div class=\"wp-block-group\"><div class=\"wp-block-group__inner-container\"><!-- wp:list {\"ordered\":true} -->\n<ol><li>Содействие в экспортных вопросах;</li><li>Содействие в регистрации на ЭТП;</li><li>Юридические консультации по вопросам участия в тендере и подписания контрактов</li><li>Подготовка пакета документов и подача заявки на участие</li><li>Заключение контракта с заказчиком</li><li>Сопровождение торгов от имени заказчика</li><li>Контроль выплаты денежных средств заказчиком</li><li>Обжалование результатов в РКП</li></ol>\n<!-- /wp:list --></div></div>\n<!-- /wp:group -->\n\n<!-- wp:separator -->\n<hr class=\"wp-block-separator\"/>\n<!-- /wp:separator -->\n\n<!-- wp:heading {\"level\":3} -->\n<h3><a href=\"https://abrok.uz/обучение/\" target=\"_blank\" rel=\"noreferrer noopener\"><span class=\"has-inline-color has-very-dark-gray-color\"><strong>Обучение</strong></span></a></h3>\n<!-- /wp:heading -->\n\n<!-- wp:list -->\n<ul><li><strong>Государственные закупки РУз </strong>- онлайн курс обучения  в области тендеров (государственных и корпоративных закупок, закупочных конкурсов, аукционов).</li></ul>\n<!-- /wp:list -->\n\n<!-- wp:list -->\n<ul><li><strong>Успешный брокер</strong> - отличное решение для брокерских компаний, желающих расширить штат трейдеров в торговом зале.</li></ul>\n<!-- /wp:list -->', 'Услуги', '', 'inherit', 'closed', 'closed', '', '153-revision-v1', '', '', '2020-07-06 19:51:04', '2020-07-06 16:51:04', '', 153, 'https://abrok.uz/2020/07/06/153-revision-v1/', 0, 'revision', '', 0),
