(303, 8, '2020-07-26 10:57:59', '2020-07-26 07:57:59', '<div class=\"changeCon\">\r\n<div></div>\r\n<div>23 июля 2020 года в Telegram канале Kurbanoff.net опубликована информация о ценах на кислородный концентратор, согласно которой на сайте электронного магазина по государственным закупкам <u>eshop.uzex.uz</u> стоимость кислородного концентратора составляет 11,0 и 30,0 млн сумов, а на веб-сайте <u>olx.uz</u> – 7,7 млн сумов.</div>\r\n<div></div>\r\n<div>Немного позднее автор публикации внес уточнение о том, что кислородный концентратор по вышеуказанной цене в наличии уже не имеется на вебсайте <u>olx.uz</u>, а цена на сайте государственных закупок не является фактически ценой сделки.</div>\r\n<div></div>\r\n<div>Вместе с тем, в целях более детального разъяснения данного вопроса, дополнительно сообщаем следующее.</div>\r\n<div></div>\r\n<div>Цена, размещенная в электронном магазине является публичной офертой участников (продавцов) и не является ценой по которой осуществляются государственные закупки. В результате применения механизма запроса цен в электронном магазине цена сделки может быть ниже стоимости оферты.</div>\r\n<div></div>\r\n<div>Например, согласно последним данным, 14 июля 2020 года на специальном информационном портале по государственным закупкам <u>xarid.uz</u> заключена сделка по реализации кислородного концентратора. По итогам прошедших торгов, стартовая стоимость одного комплекта кислородного концентратора составила 9 800 000, а цена закупки – 9 408 000 сумов. При этом, экономия бюджетных средств составила 392 000 сумов. Медицинская техника приобретена Фтизиатрическим диспансером Кашкадарьинской области.</div>\r\n<div></div>\r\n<div>В целом, с начала 2020 года на специальном информационном портале по государственным закупкам <u>xarid.uz</u> заключено сделок на общую сумму 1 849,6 млрд сумов. В результате проведения конкурентных электронных торгов экономия средств бюджетных и корпоративных заказчиков составила 403,4 млрд сумов (18% относительно стартовой стоимости).</div>\r\n<div></div>\r\n<div>В целях обеспечения объективности и достоверности предоставляемой информации, просим блогеров и представителей СМИ при подготовке материалов, затрагивающих государственные закупки, обращаться в PR отдел АО «Узбекская республиканская товарно-сырьевая биржа» и в Информационную службу Министерства финансов Республики Узбекистан – уполномоченный орган по государственным закупкам.</div>\r\n<div></div>\r\n</div>\r\n<p class=\"r\"><strong>Источник </strong>: <a href=\"http://uzex.uz/ru/news/2020/7/23/uzex-official-statement-july-23/uzex-official-statement-july-23\" target=\"_blank\" rel=\"noopener noreferrer\">\"ЎзРТХБ\" АЖ PR бўлими</a></p>', 'ОФИЦИАЛЬНОЕ ЗАЯВЛЕНИЕ АО «УЗБЕКСКАЯ РЕСПУБЛИКАНСКАЯ ТОВАРНО-СЫРЬЕВАЯ БИРЖА»', '', 'publish', 'open', 'open', '', '%d0%be%d1%84%d0%b8%d1%86%d0%b8%d0%b0%d0%bb%d1%8c%d0%bd%d0%be%d0%b5-%d0%b7%d0%b0%d1%8f%d0%b2%d0%bb%d0%b5%d0%bd%d0%b8%d0%b5-%d0%b0%d0%be-%d1%83%d0%b7%d0%b1%d0%b5%d0%ba%d1%81%d0%ba%d0%b0%d1%8f', '', '', '2020-07-26 10:57:59', '2020-07-26 07:57:59', '', 0, 'https://abrok.uz/?p=303', 0, 'post', '', 0),
(269, 8, '2020-07-18 20:29:09', '2020-07-18 17:29:09', '<!-- wp:spacer {\"height\":72} --><!-- /wp:spacer -->\r\n\r\n<!-- wp:heading -->\r\n<h2><strong>Госзакупки и Тендеры</strong></h2>\r\n<!-- /wp:heading -->\r\n\r\n<!-- wp:paragraph -->\r\n<p>Онлайн курс обучения  в области тендеров (государственных и корпоративных закупок, закупочных конкурсов, аукционов).</p>\r\n<!-- /wp:paragraph -->\r\n\r\n<!-- wp:list -->\r\n<ul>\r\n<li>В курс программы входит 16 онлайн уроков, включающие реальный опыт и необходимые знания, для достижения главной цели обучения – выигрыша реального тендера.</li>\r\n</ul>\r\n<!-- /wp:list -->\r\n\r\n<!-- wp:list -->\r\n<ul>\r\n<li>Длительность процесса обучения 30 дней.</li>\r\n</ul>\r\n<!-- /wp:list -->\r\n\r\n<!-- wp:list -->\r\n<ul>\r\n<li>В рамках курса обучения начинающие предприниматели узнают и поймут, как работает биржа, научатся выигрывать тендеры,  а те кто уже имеет опыт работы на бирже получат доступ к секретным инструментам и знаниям для результативной работы на торговых площадках.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<!-- /wp:list -->\r\n\r\n<!-- wp:separator --><hr class=\"wp-block-separator\" /><!-- /wp:separator -->\r\n\r\n<!-- wp:heading -->\r\n<h2><strong>Успешный брокер</strong></h2>\r\n<!-- /wp:heading -->\r\n\r\n<!-- wp:list -->\r\n<ul>\r\n<li>Отличное решение для брокерских компаний, желающих расширить штат трейдеров в торговом зале.</li>\r\n<li>Инновационная программа подготовки специалистов биржевого, товарного рынка Узбекистана.</li>\r\n<li>Данный курс рекомендуется тем, кто хочет обучиться профессии брокера, а также для бизнесменов, которые устали выплачивать постоянный % брокерам и решили обучится сами или обучить сотрудника.</li>\r\n<li>Эффективный курс подготовки трейдеров к тестам на бирже УзРТСБ. Мы помогаем пройти аттестацию на UZEX.</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<!-- /wp:list -->', 'Обучение', '', 'inherit', 'closed', 'closed', '', '158-revision-v1', '', '', '2020-07-18 20:29:09', '2020-07-18 17:29:09', '', 158, 'https://abrok.uz/2020/07/18/158-revision-v1/', 0, 'revision', '', 0),
