(294, 8, '2020-07-19 12:49:00', '2020-07-19 09:49:00', '<div class=\"changeCon\">\r\n<div>Председатель Правления АО «Узбекская республиканская товарно-сырьевая биржа» Зиёвиддин Бадриддинов открыл свой телеграм-бот и электронную почту для эффективного общения с населением, предпринимателями, участниками торгов и другими клиентами биржи по вопросам биржевой деятельности.</div>\r\n<div></div>\r\n<div>Теперь любой пользователь может направить свой вопрос или предложение по биржевой деятельности непосредственно руководителю биржи UZEX через телеграм-бот @UzexMarkazBot или электронную почту markaz@rtsb.uz.</div>\r\n<div></div>\r\n<div>Главной целью создания прямой обратной связи с председателем биржи является своевременное выявление, всестороннее изучение и оперативное устранение проблемных вопросов, а также оптимизация и повышение эффективности деятельности биржи.</div>\r\n<div></div>\r\n<div>Расширение каналов связи с клиентами полностью соответствуют принципам открытости и является одним из приоритетных направлений в деятельности Узбекской республиканской товарно-сырьевой биржи.</div>\r\n<div></div>\r\n<div>Напомним, что на бирже также функционирует круглосуточный телеграм-бот обратной связи с клиентами @uzexfeedbackbot и Call-центр по телефонному номеру (+71) 207-00-33.</div>\r\n<div></div>\r\n</div>\r\n<p class=\"r\"><strong>Источник </strong>: <a href=\"https://uzex.uz/ru/news/2020/7/17/uzex-ceo-feedback-channels-were-launched/uzex-ceo-feedback-channels-were-launched\" target=\"_blank\" rel=\"noopener noreferrer\">\"ЎзРТХБ\" АЖ PR бўлими</a></p>', 'ЗАПУЩЕНЫ КАНАЛЫ ОБРАТНОЙ СВЯЗИ С РУКОВОДИТЕЛЕМ БИРЖИ', 'Председатель Правления АО «Узбекская республиканская товарно-сырьевая биржа» Зиёвиддин Бадриддинов открыл свой телеграм-бот и электронную почту для эффективного общения с населением, предпринимателями, участниками торгов и другими клиентами биржи по вопросам биржевой деятельности.', 'publish', 'open', 'open', '', '%d0%b7%d0%b0%d0%bf%d1%83%d1%89%d0%b5%d0%bd%d1%8b-%d0%ba%d0%b0%d0%bd%d0%b0%d0%bb%d1%8b-%d0%be%d0%b1%d1%80%d0%b0%d1%82%d0%bd%d0%be%d0%b9-%d1%81%d0%b2%d1%8f%d0%b7%d0%b8-%d1%81-%d1%80%d1%83%d0%ba%d0%be', '', '', '2020-07-21 03:00:32', '2020-07-21 00:00:32', '', 0, 'https://abrok.uz/?p=294', 0, 'post', '', 0),
