(314, 8, '2020-07-29 19:18:57', '2020-07-29 16:18:57', '29 июл 2020\r\n29 июля 2020 года Узбекская республиканская товарно-сырьевая биржа и оператор мобильной связи «Mobiuz» заключили соглашение о реализации через онлайн-аукцион биржи востребованные мобильные номера.\r\n \r\nГлавной целью подписания данного соглашения является расширение доступа к востребованным мобильным номерам «Mobiuz» посредством их продаж в режиме онлайн.\r\n \r\nВ рамках данного сотрудничества с 15 августа ожидается начало продаж мобильных номеров платных категорий компании «Mobiuz» на платформе биржи mobilraqam.uzex.uz.\r\n \r\nНапомним, что данная торговая платформа запущена в 2019 году для реализации мобильных номеров с востребованной комбинацией цифр через онлайн-аукционы биржи.\r\n \r\nОжидаемые онлайн-торги будут проводиться на принципах открытости, прозрачности, конкурентности и обеспечения равного доступа для всех участников торгов.\r\n \r\nЗа дополнительной информацией, касательно участия в онлайн-аукционах, можно обратиться в Call-центр биржи по телефонному номеру (+71) 207-00-33 или посредством телеграм-бота @uzexfeedbackbot.\r\n \r\nИсточник : <a href=\"http://uzex.uz/ru/news/2020/7/29/mobiuz-mobile-numbers-will-be-sold-through-the-uzex-online-auctions/mobiuz-mobile-numbers-will-be-sold-through-the-uzex-online-auctions\">\"ЎзРТХБ\" АЖ PR бўлими</a>', '“КРАСИВЫЕ” МОБИЛЬНЫЕ НОМЕРА MOBIUZ БУДУТ ПРОДАВАТЬ ЧЕРЕЗ ОНЛАЙН-АУКЦИОНЫ БИРЖИ', '', 'publish', 'open', 'open', '', '%d0%ba%d1%80%d0%b0%d1%81%d0%b8%d0%b2%d1%8b%d0%b5-%d0%bc%d0%be%d0%b1%d0%b8%d0%bb%d1%8c%d0%bd%d1%8b%d0%b5-%d0%bd%d0%be%d0%bc%d0%b5%d1%80%d0%b0-mobiuz-%d0%b1%d1%83%d0%b4%d1%83%d1%82', '', '', '2020-07-29 19:19:58', '2020-07-29 16:19:58', '', 0, 'https://abrok.uz/?p=314', 0, 'post', '', 0),
