(321, 8, '2020-07-31 06:31:44', '2020-07-31 03:31:44', '<p style=\"text-align: center;\"><strong>Дорогие соотечественники!</strong></p>\r\n<p style=\"text-align: center;\">Искренне, от всей души поздравляю вас, всю мусульманскую умму страны, весь наш народ со священным праздником Курбан-Хайит, который мы отмечаем вместе со всем исламским миром.</p>\r\n<p style=\"text-align: center;\">Этот прекрасный праздник, испокон веков занимающий особое место в нашей духовной жизни, является символом доброты, взаимопонимания и толерантности.</p>\r\n<p style=\"text-align: center;\">В эти благословенные дни желаю вам, всему народу Узбекистана здоровья, счастья, мира и благополучия.</p>\r\n<p style=\"text-align: center;\">В нынешних условиях, когда нас, как и все другие страны мира, не обошло стороной тяжелое испытание – пандемия коронавируса, мы еще глубже осознаем огромную роль и значение Курбан-Хайита в жизни нашего общества.</p>\r\n<p style=\"text-align: center;\">Сегодня совершение добрых дел, взаимопомощь, милосердие и щедрость, сохранение мира и спокойствия приобретают особую актуальность. Именно эти высокие духовные ценности придают всем нам еще больше сил и энергии, выдержки и стойкости.</p>\r\n<p style=\"text-align: center;\">Несмотря на принятые нашим государством и обществом необходимые меры, к сожалению, имеются случаи смерти от коронавирусной инфекции. Выражаю самые искренние соболезнования и глубокое сочувствие родным и близким наших соотечественников, жизни которых унесла эта коварная болезнь.</p>\r\n<p style=\"text-align: center;\">Все мы хорошо понимаем, что из-за пандемии нам пришлось ввести некоторые ограничения на проведение массовых мероприятий, в том числе религиозных церемоний, связанных также и с Курбан-Хайитом.</p>\r\n<p style=\"text-align: center;\">В священном Коране неоднократно говорится о том, что лишь тот удостоится наивысшей благодати, кто украшает жизнь добрыми делами.</p>\r\n<p style=\"text-align: center;\">Сегодня, в дни испытаний, следование таким вечным истинам способствует укреплению в нашем обществе атмосферы гуманизма и согласия, дружбы и сплоченности.</p>\r\n<p style=\"text-align: center;\">Действительно, в это нелегкое время Всевышний открывает перед нами новые возможности для проявления милосердия и благих свершений. Заслуживает большого уважения, что многие наши соотечественники считают своим долгом оказывать помощь нуждающимся, материально и морально поддерживать тех, кто в связи с пандемией остался без работы, лишился постоянного источника дохода. Ведь, как сказано в священных хадисах, истинный мусульманин желает другим людям только добра, как самому себе.</p>\r\n<p style=\"text-align: center;\">Всевышний непременно вознаградит отзывчивых, великодушных людей с чистым сердцем, которые помогают нуждающимся родственникам, жителям своей махалли, другим соотечественникам и своей бескорыстной заботой приносят радость в дома тех, кто обделен судьбой.</p>\r\n<p style=\"text-align: center;\">Именно поэтому организованное в нашей стране общенародное движение «Доброта и поддержка» стало сегодня по-настоящему мощной силой. Об этом ярко свидетельствуют осуществленная за короткий срок в рамках движения огромная благотворительная работа и многочисленные мероприятия.</p>\r\n<p style=\"text-align: center;\">Как логическое продолжение всей этой нашей работы и для дальнейшего усиления поддержки со стороны государства малообеспеченных слоев населения и семей, не имеющих постоянного источника дохода, нуждающихся в помощи, а также экономики сегодня я подписал Указ, в соответствии с которым на эти цели из республиканского бюджета в дополнение к ранее выделенным 10 триллионам сумов будет направлено еще около 2,5 триллиона сумов.</p>\r\n<p style=\"text-align: center;\">Наряду с этим для поощрения представителей религиозно-духовной сферы, широко пропагандирующих идеи мира, дружбы, милосердия и согласия, а также чтобы поднять на новый уровень благотворительную работу на местах и повысить эффективность масштабных мероприятий, проводимых на основе принципа «просвещение против невежества», благотворительному общественному фонду «Вакф» при Управлении мусульман Узбекистана будут выделены средства в размере 150 миллиардов сумов.</p>\r\n<p style=\"text-align: center;\">Дорогие соотечественники!</p>\r\n<p style=\"text-align: center;\">Жить с чистыми помыслами и высокими устремлениями испокон веков присуще нашему народу. Как сказал великий поэт и мыслитель Алишер Навои: «У того, кто имеет благие намерения, крепче вера в Аллаха».</p>\r\n<p style=\"text-align: center;\">В эти благословенные дни от всей души поздравляю с праздником Курбан-Хайит народы мусульманских стран ближнего и дальнего зарубежья, всех наших друзей и партнеров, желаю им мира и прогресса.</p>\r\n<p style=\"text-align: center;\">Еще раз искренне, от всего сердца поздравляю вас, уважаемые соотечественники, с этим светлым праздником.</p>\r\n<p style=\"text-align: center;\">Пусть еще более прочными будут единство, дружба и сплоченность нашего многонационального народа!</p>\r\n<p style=\"text-align: center;\">Пусть всегда в нашем родном Узбекистане, в наших семьях царят мир, спокойствие и благополучие!</p>\r\n<p style=\"text-align: center;\">Пусть Всевышний поддерживает нас во всех добрых делах и начинаниях!</p>\r\n<p style=\"text-align: center;\"><em><strong>Шавкат Мирзиёев,</strong></em></p>\r\n<p style=\"text-align: center;\"><em><strong>Президент Республики Узбекистан</strong></em></p>\r\n<p style=\"text-align: center;\"></p>', 'Поздравление Президента народу Узбекистана с праздником Курбан-Хайит', '', 'inherit', 'closed', 'closed', '', '318-revision-v1', '', '', '2020-07-31 06:31:44', '2020-07-31 03:31:44', '', 318, 'https://abrok.uz/2020/07/31/318-revision-v1/', 0, 'revision', '', 0),
