(391, 8, '2020-08-12 17:34:24', '2020-08-12 14:34:24', 'Узбекская республиканская товарно-сырьевая биржа запустила систему электронного документооборота <a href=\"http://exdoc.uz/\">exdoc.uz</a>. Это третий крупный проект, реализованный биржей в 2020 году – в “Год развития науки, образования и цифровой экономики” (первый проект - обновленный ВЯТ, второй - электронный конкурс и тендер).\r\n<div class=\"changeCon\">\r\n<div></div>\r\n<div><strong><a href=\"http://exdoc.uz/\">EXDOC</a></strong> – это удобная услуга биржи по электронной счёт-фактуре, которой могут свободно пользоваться не только участники биржевых торгов, но также и другие предприятия и организации.</div>\r\n<div></div>\r\n<div>В системе за 5 минут с помощью электронной цифровой подписи можно подписывать, отправлять и получать документы, имеющие юридическую силу. Новый электронный сервис биржи предоставляет возможность передавать документы по специально зашифрованному каналу и проверять их статус исполнения.</div>\r\n<div></div>\r\n<div>Система электронного документооборота биржи <strong>UZEX </strong>экономит время и деньги пользователей, снижает вероятность допущения ошибок в оформлении документов и повышает эффективность бизнес-процессов.</div>\r\n<div></div>\r\n<div>Удобный интерфейс веб-сайта и «умная» поисковая система обеспечивает быстрый процесс передачи документов в электронном виде. В ближайшем будущем ожидается подключение сервиса к 1С и биллинговой системе.</div>\r\n<div></div>\r\n<div>Данная система была разработана и внедрена ООО «Uzex innovation» при Узбекской республиканской товарно-сырьевой биржи в соответствии с Постановлениями Кабинета Министров Республики Узбекистан № 170 от 18 марта 2020 года и № 522 от 25 июня 2019 года.</div>\r\n<div></div>\r\n<div></div>\r\n</div>\r\n<p class=\"r\"><strong>Источник </strong>: <a href=\"https://uzex.uz/ru/news/2020/8/6/uzex-launches-e-documents-flow-service/uzex-launches-e-documents-flow-service\" target=\"_blank\" rel=\"noopener noreferrer\">\"ЎзРТХБ\" АЖ PR бўлими</a></p>\r\n&nbsp;', 'UZEX | EXDOC - систему электронного документооборота', '', 'inherit', 'closed', 'closed', '', '389-revision-v1', '', '', '2020-08-12 17:34:24', '2020-08-12 14:34:24', '', 389, 'https://abrok.uz/2020/08/12/389-revision-v1/', 0, 'revision', '', 0),
