(586, 8, '2020-11-24 20:03:50', '2020-11-24 17:03:50', 'Впервые в Украине, в городе Киеве открылась зарубежная торговая площадка АО «Узбекская республиканская товарно-сырьевая биржа». Учредителем новой зарубежной торговой площадки биржи стала украинская компания ОО «ТРЕЙД-BB».\r\n<div class=\"changeCon\">\r\n\r\nОткрытие и регистрация зарубежной торговой площадки прошло во время делового визита делегации Узбекской республиканской товарно-сырьевой биржи в Украину.\r\n\r\nВ настоящее время новая торговая площадка биржи подала первую заявку зарубежного клиента по реализации 500 тонн подсолнечного масла в Республику Узбекистан.\r\n\r\nТаким образом, в настоящее время международная торговая сеть АО «Узбекской республиканской товарно-сырьевой биржи» насчитывает 15 зарубежных торговых площадок.\r\n\r\n<em>Для справки: Зарубежные торговые площадки это удаленные торговые офисы биржи, подключенные к единой системе электронных биржевых торгов. Они предоставляют предпринимателям свободный доступ к биржевым торгам и возможность самостоятельно регистрировать биржевые сделки.</em>\r\n\r\n</div>\r\n<p class=\"r\"><strong>Источник : </strong><a href=\"http://uzex.uz/ru/news/2020/11/23/the-first-trading-platform-of-the-uzbek-exchange-was-opened-in-ukraine/the-first-trading-platform-of-the-uzbek-exchange-was-opened-in-ukraine\" target=\"_blank\" rel=\"noopener noreferrer\">\"ЎзРТХБ\" АЖ PR бўлими</a></p>', 'В УКРАИНЕ ОТКРЫЛАСЬ ПЕРВАЯ ТОРГОВАЯ ПЛОЩАДКА УЗБЕКСКОЙ БИРЖИ', '', 'publish', 'open', 'open', '', '%d0%b2-%d1%83%d0%ba%d1%80%d0%b0%d0%b8%d0%bd%d0%b5-%d0%be%d1%82%d0%ba%d1%80%d1%8b%d0%bb%d0%b0%d1%81%d1%8c-%d0%bf%d0%b5%d1%80%d0%b2%d0%b0%d1%8f-%d1%82%d0%be%d1%80%d0%b3%d0%be%d0%b2%d0%b0%d1%8f-%d0%bf', '', '', '2020-11-24 20:03:58', '2020-11-24 17:03:58', '', 0, 'https://abrok.uz/?p=586', 0, 'post', '', 0),
