(591, 8, '2020-11-24 20:06:46', '2020-11-24 17:06:46', '<span class=\"release-date\">23 ноя 2020</span>\r\n<div class=\"changeCon\">\r\n<div>19 ноября – в последний день визита руководителей Узбекской республиканской товарно-сырьевой биржи в Украину, при поддержке Министерства иностранных дел Украины и посольства Узбекистана в Украине, организованы деловые встречи с представителями украинских продовольственных компаний и церемония подписания ряда итоговых документов.</div>\r\n<div></div>\r\n<div>Так, в частности в Министерстве иностранных дел Украины состоялась встреча председателя правления АО «Узбекская республиканская товарно-сырьевая биржа» Зиёвиддина Бадриддинова с руководителем Союза «Мукомолы Украины» Родионом Рыбчинским. Переговоры прошли при участии заместителя министра иностранных дел Украины Дмитрия Сеника и посла Узбекистана в Украине Алишера Курманова.</div>\r\n<div></div>\r\n<div>Итоговым документом данной встречи стал Протокол о сотрудничестве между АО «Узбекская республиканская товарно-сырьевая биржа» и Союзом «Мукомолы Украины», который предусматривает организацию участия членов Союза «Мукомолы Украины» в электронных торгах узбекской биржи.</div>\r\n</div>\r\n<div>\r\n<div></div>\r\n<div>Аналогичная встреча и церемония подписания Протокола о сотрудничестве также состоялась между АО «Узбекская республиканская товарно-сырьевая биржа» и ЗАО “Чумак”.</div>\r\n<div></div>\r\n<div>Согласно данному протоколу стороны согласовали механизм определения ценновых параметров выставляемой на торги продукций, а также инструменты взаиморасчетов, сроков и условий поставок.</div>\r\n<div></div>\r\n<div>Кроме того, подписан Меморандум о взаимодействии между Акционерным обществом «Узбекская республиканская товарно-сырьевая биржа» и Обществом с ограниченной ответственностью «Панда».</div>\r\n<div></div>\r\n<div>В соответствии с документом, стороны договорились реализовать на территории Республики Узбекистан сахарной продукцию, произведенную в Украине, на основе использования возможностей инструментов биржевой торговли и электронной коммерции.</div>\r\n<div></div>\r\n<div>Подписание вышеназванных документов будут служить задачам по обеспечению в Узбекистане продовольственной безопасности и сохранению стабильности цен на внутреннем рынке посредством осуществления импорта востребованных продовольственных товаров при помощи биржевого механизма.</div>\r\n</div>', '', '', 'inherit', 'closed', 'closed', '', '589-revision-v1', '', '', '2020-11-24 20:06:46', '2020-11-24 17:06:46', '', 589, 'https://abrok.uz/2020/11/24/589-revision-v1/', 0, 'revision', '', 0),
