INSERT INTO `wp_wc_admin_notes` (`note_id`, `name`, `type`, `locale`, `title`, `content`, `icon`, `content_data`, `status`, `source`, `date_created`, `date_reminder`, `is_snoozable`) VALUES
(1, 'wc-admin-welcome-note', 'info', 'en_US', 'Новые возможности', 'Добро пожаловать в новую среду WooCommerce! В этом новом выпуске вы сможете на специальной консоли увидеть, как работает ваш магазин, управлять важными аспектами вашего бизнеса (такими как управление заказами, запасами, отзывами) из любой точки интерфейса, разобраться в данных, поступающих из вашего магазина, с помощью совершенно нового раздела аналитики и многое другое!', 'info', '{}', 'unactioned', 'woocommerce-admin', '2020-05-02 20:02:05', NULL, 0),
(2, 'wc-admin-store-notice-setting-moved', 'info', 'en_US', 'Ищете настройки \"Уведомление магазина\"?', 'Это можно найти в конфигураторе.', 'info', '{}', 'unactioned', 'woocommerce-admin', '2020-05-02 20:02:05', NULL, 0),
(3, 'wc-admin-wc-helper-connection', 'info', 'en_US', 'Подключиться к WooCommerce.com', 'Подключайтесь, чтобы получать важные уведомления о продукте и обновления.', 'info', '{}', 'unactioned', 'woocommerce-admin', '2020-05-02 20:02:06', NULL, 0),
(4, 'wc-admin-add-first-product', 'info', 'en_US', 'Добавьте свой первый продукт', 'Увеличьте свой доход, добавив товары в ваш магазин. Добавьте продукты вручную, импортируйте из электронной таблицы или перенесите с другой платформы', 'product', '{}', 'unactioned', 'woocommerce-admin', '2020-05-02 20:02:06', NULL, 0),
(5, 'wc-admin-mobile-app', 'info', 'en_US', 'Установите мобильное приложение Woo', 'Установите мобильное приложение WooCommerce для управления заказами, получения уведомлений о продажах и просмотра ключевых показателей — где бы вы ни находились.', 'phone', '{}', 'unactioned', 'woocommerce-admin', '2020-05-04 21:04:17', NULL, 0),
(6, 'wc-admin-store-notice-giving-feedback', 'info', 'en_US', 'Просмотрите свой результат', 'Если вам нравится WooCommerce Admin, пожалуйста, поставьте нам оценку 5 звезд. Заранее благодарим!', 'info', '{}', 'unactioned', 'woocommerce-admin', '2020-05-05 21:12:19', NULL, 0),
(7, 'wc-admin-facebook-extension', 'info', 'en_US', 'Маркетинг на Facebook', 'Развивайте свой бизнес, ориентируясь на нужных людей и стимулируя продажи с помощью Facebook. Вы можете установить это бесплатное расширение сейчас.', 'thumbs-up', '{}', 'unactioned', 'woocommerce-admin', '2020-05-05 21:12:19', NULL, 0),
(8, 'wc-admin-usage-tracking-opt-in', 'info', 'en_US', 'Помогите WooCommerce стать лучше, согласившись делиться данными об использовании.', 'Сбор данных об использовании позволяет нам улучшить WooCommerce. Информация о вашем магазине будет использоваться для оценки новых функций, определения качества обновлений и принятия решений о целесообразности дальнейших улучшений. Вы всегда можете зайти в <a href=\"https://abrok.uz/wp-admin/admin.php?page=wc-settings&#038;tab=advanced&#038;section=woocommerce_com\" target=\"_blank\">Настройки</a> и выбрать отмену отправки ваших данных. <a href=\"https://woocommerce.com/usage-tracking\" target=\"_blank\">Читать подробнее</a> о том, какие данные мы собираем.', 'info', '{}', 'unactioned', 'woocommerce-admin', '2020-05-09 22:08:52', NULL, 0),
(13, 'wc-admin-orders-milestone', 'info', 'en_US', 'Поздравляем с обработкой 10 заказов!', 'Вы достигли уровня в 10 заказов! Посмотрите на свой прогресс. Для мотивации просмотрите некоторые истории успеха пользователей WooCommerce.', 'trophy', '{}', 'unactioned', 'woocommerce-admin', '2021-01-09 23:38:00', NULL, 0),
(12, 'wc-admin-new-sales-record', 'info', 'en_US', 'Новый рекорд продаж!', 'Ого, November 18th был вашим рекордным днем по продажам! Чистый объем продажUZS36,000,000.00 побил предыдущий рекорд UZS14,000,000.00 установленный на November 11th.', 'trophy', '{\"old_record_date\":\"2020-11-11\",\"old_record_amt\":14000000,\"new_record_date\":\"2020-11-18\",\"new_record_amt\":36000000}', 'unactioned', 'woocommerce-admin', '2020-11-19 20:19:37', NULL, 0);
